public V next() {
  if (hasNext()) {
    Map.Entry<byte[], byte[]> nextRaw = internalDbIterator.next();
    try {
      V result = getEntityForKey(nextRaw.getKey());
      return result;
    } catch (IOException e) {
      LOG.error("GenericObjectMapper cannot read key from key "
          + nextRaw.getKey()
          + " into an object. Read aborted! ");
      LOG.error(e.getMessage());
    }
  }
  return null;
}
